import React from 'react';

import Card from 'react-bootstrap/Card';

const Goal = (props) => {
   return (
      <div>
         <Card>
            <Card.Body className="fw-bold">{ props.name }</Card.Body>
         </Card>
      </div>
   );
};

export default Goal;
